import React from "react";
import "./home.css"
import Footer from "../../footer/footer";
import logo from "../.././"

export const Home = () => {
  return (
    <div>
      <div>
        <p className="title">Welcome to Jinchi</p>
      </div>
      <div>
        <img src={logo}></img>
      </div>
      <div className="footer">
        <Footer />
      </div>
    </div>


  );
};
